"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[2274],{403:(t,o,s)=>{s.r(o),s.d(o,{assets:()=>c,contentTitle:()=>i,default:()=>l,frontMatter:()=>n,metadata:()=>r,toc:()=>p});var a=s(4848),e=s(8453);const n={title:"Como configurar tempo estimado?"},i=void 0,r={id:"cadastros/como-configurar-tempo-estimado-",title:"Como configurar tempo estimado?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/cadastros/como-configurar-tempo-estimado-.mdx",sourceDirName:"cadastros",slug:"/cadastros/como-configurar-tempo-estimado-",permalink:"/ajudafacitysistemas/en/docs/cadastros/como-configurar-tempo-estimado-",draft:!1,unlisted:!1,editUrl:"https://github.com/ajudafacity/ajudafacitysistemas/edit/main/docs/cadastros/como-configurar-tempo-estimado-.mdx",tags:[],version:"current",frontMatter:{title:"Como configurar tempo estimado?"},sidebar:"tutorialSidebar",previous:{title:"Como configurar taxas de entrega (bairro)?",permalink:"/ajudafacitysistemas/en/docs/cadastros/como-configurar-taxas-de-entrega--bairro--"},next:{title:"Como criar auto respostas e instalar o Facity BOT?",permalink:"/ajudafacitysistemas/en/docs/cadastros/como-criar-auto-respostas-e-instalar-o-facity-bot-"}},c={},p=[];function m(t){return(0,a.jsx)(a.Fragment,{children:(0,a.jsx)(a.Fragment,{children:(0,a.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p class="has-small-font-size">Configurar o tempo estimado \xe9 uma forma de otimizar o tempo de atendimento na sua empresa. Com o <strong>Facity Controle</strong>, \xe9 poss\xedvel configurar o tempo estimado de forma f\xe1cil e r\xe1pida. Neste post, vamos mostrar como fazer isso passo a passo.</p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1: </strong>Abra o <strong>Facity Controle</strong> em seu computador</p>\n\n\n\n<p class="has-small-font-size">Para come\xe7ar, abra o <strong>Facity Controle</strong> em seu computador. Certifique-se de que tem o<strong> login </strong>e <strong>senha corretos da sua empresa</strong>. Lembre-se de que tudo tem que ser digitado em<em> letras min\xfasculas</em>.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="900" height="547" src="http://blog.facity.com.br/wp-content/uploads/2022/11/image-40.png" alt="" class="wp-image-851" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/image-40.png 900w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-40-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-40-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-40-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2: </strong>Clique em <strong>&#8220;Configura\xe7\xf5es&#8221;</strong></p>\n\n\n\n<p class="has-small-font-size">No menu lateral \xe0 esquerda, clique em <strong>&#8220;Configura\xe7\xf5es&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="464" src="http://blog.facity.com.br/wp-content/uploads/2022/11/image-41-1024x464.png" alt="" class="wp-image-852" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/image-41-1024x464.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-41-300x136.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-41-768x348.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-41-720x326.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-41.png 1347w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3: </strong>Clique em <strong>&#8220;Tempo Estimado&#8221;</strong></p>\n\n\n\n<p class="has-small-font-size">Dentro de <strong>&#8220;Configura\xe7\xf5es&#8221;</strong>, clique em <strong>&#8220;Tempo Estimado&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="481" src="http://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-18_55_37-1024x481.png" alt="" class="wp-image-853" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-18_55_37-1024x481.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-18_55_37-300x141.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-18_55_37-768x361.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-18_55_37-720x338.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-18_55_37.png 1314w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4:</strong> Configure o tempo estimado</p>\n\n\n\n<p class="has-small-font-size">Na tela de <strong>&#8220;Tempo Estimado&#8221;</strong>, \xe9 poss\xedvel configurar o tempo estimado para cada servi\xe7o prestado pela sua empresa. Para alterar os hor\xe1rios, clique no rel\xf3gio e ajuste o tempo estimado conforme necess\xe1rio. Depois de configurar o tempo estimado, clique em <strong>&#8220;Salvar&#8221;</strong> para confirmar as altera\xe7\xf5es.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="468" src="http://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-19_02_41-1024x468.png" alt="" class="wp-image-854" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-19_02_41-1024x468.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-19_02_41-300x137.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-19_02_41-768x351.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-19_02_41-720x329.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/12_11_2022-19_02_41.png 1321w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">Seguindo esses passos simples, voc\xea pode configurar o tempo estimado na sua empresa de forma r\xe1pida e f\xe1cil. Com essa configura\xe7\xe3o, \xe9 poss\xedvel otimizar o tempo de atendimento e oferecer um servi\xe7o mais eficiente para os seus clientes.</p>\n\n'}})})})}function l(t={}){const{wrapper:o}={...(0,e.R)(),...t.components};return o?(0,a.jsx)(o,{...t,children:(0,a.jsx)(m,{...t})}):m()}},8453:(t,o,s)=>{s.d(o,{R:()=>i,x:()=>r});var a=s(6540);const e={},n=a.createContext(e);function i(t){const o=a.useContext(n);return a.useMemo((function(){return"function"==typeof t?t(o):{...o,...t}}),[o,t])}function r(t){let o;return o=t.disableParentContext?"function"==typeof t.components?t.components(e):t.components||e:i(t.components),a.createElement(n.Provider,{value:o},t.children)}}}]);